    @SuppressWarnings("deprecation")
    @Test
    @Transactional()
    public void test1() {
        for (String entry : resultMap2) {
            System.out.println("========================" + entry + "开始检测======================");
            List<Object> result = new ArrayList();
            strs = resultMap.get(entry).split(",");
            List<Map> list = simpleDao.getNativeQueryList("SELECT * FROM POLLUTION_info_DATA where QX='" + entry + "' and jd is not  null and wd is not null");
            System.out.println(list.size());
            int idx = 0;
            for (Map map : list) {
                String jd = map.get("jd").toString();
                String wd = map.get("wd").toString();
                String qx = PreceedPointInAreaUtil.findBelongQx(jd, wd);
                if (!map.get("qx").toString().equals(qx)) {
                    result.add(map.get("uuid"));
                    for (int j = 0; j < 1000; j++) {
                        int chooise = new Random().nextInt(4);
                        int i = new Random().nextInt(strs.length);
                        String[] temp = strs[i].split(" ");

                        double rondom = new Random().nextInt(1000);
                        double rondom2 = new Random().nextInt(1000);
                        double newjd = 0;
                        double newwd = 0;
                        if (chooise == 0) {
                            newjd = Double.parseDouble(temp[0]) + rondom / 1000;
                            newwd = Double.parseDouble(temp[1]) + rondom2 / 1000;
                        }
                        if (chooise == 1) {
                            newjd = Double.parseDouble(temp[0]) + rondom / 100000;
                            newwd = Double.parseDouble(temp[1]) - rondom2 / 100000;
                        }
                        if (chooise == 2) {
                            newjd = Double.parseDouble(temp[0]) - rondom / 100000;
                            newwd = Double.parseDouble(temp[1]) + rondom2 / 100000;
                        }
                        if (chooise == 3) {
                            newjd = Double.parseDouble(temp[0]) - rondom / 100000;
                            newwd = Double.parseDouble(temp[1]) - rondom2 / 100000;
                        }
                        if (entry.equals("龙海市") && PreceedPointInAreaUtil.preceedPointInArea(newjd + "", newwd + "", resultMap.get("漳州高新技术产业开发区").split(","), "")) {
                            continue;
                        }
                        if (entry.equals("龙海市") && PreceedPointInAreaUtil.preceedPointInArea(newjd + "", newwd + "", resultMap.get("台商投资区").split(","), "")) {
                            continue;
                        }
                        if (entry.equals("龙海市") && PreceedPointInAreaUtil.preceedPointInArea(newjd + "", newwd + "", resultMap.get("招商局漳州开发区").split(","), "")) {
                            continue;
                        }
                        if (entry.equals("漳浦县") && PreceedPointInAreaUtil.preceedPointInArea(newjd + "", newwd + "", resultMap.get("古雷港经济开发区").split(","), "")) {
                            continue;
                        }
                        if (entry.equals("云霄县") && PreceedPointInAreaUtil.preceedPointInArea(newjd + "", newwd + "", resultMap.get("常山华侨经济开发区").split(","), "")) {
                            continue;
                        }
                        if (PreceedPointInAreaUtil.findBelongQx(newjd + "", newwd + "").equals(entry)) {
                            idx++;
//						System.out.println(newwd + " " + newjd);
                            simpleDao.createNativeQuery("update POLLUTION_INFO_DATA set jd='" + newjd + "' , wd='" + newwd + "' where uuid='" + map.get("uuid") + "'").executeUpdate();
                            break;
                        }
                    }
                }
            }
            System.out.println(result.toString());
            System.out.println(entry + "不在范围内的总数:" + result.size() + "条，其中转换了" + idx + "条");
            System.out.println("========================" + entry + "结束检测======================");
            System.out.println();
            System.out.println();
        }


    }

